import React, { useState, useContext } from 'react'
import { View, Text, TouchableOpacity, ScrollView } from 'react-native';
import { Badge } from 'react-native-elements'
import { PRIMARY, SECONDARY, SUCCESS, WHITE } from '../../../const/Colors';
import PickerMultiSelect from '../../../UI/PickerMultiSelect';
import Fab from '../../../UI/Fab';
import CardWithText from '../../../UI/CardWithText';
import PickerSingleSelect from '../../../UI/PickerSingleSelect';
import RadioButton from '../../../UI/RadioButton';
import TextArea from '../../../UI/TextArea';
import { useForm } from '../../../hooks/useForm';
import { RecordContext } from '../../../context/RecordFile/RecordContext';

export const Pain = ({navigation}) => {

    const { saveDimension, currentRecord } = useContext(RecordContext);
    const thereIsDimension = currentRecord.clinical_interview.length > 0 && currentRecord.clinical_interview.some(item => item._id === '000000000000000000000001');
    const currentDimension = currentRecord.clinical_interview.find(item => item._id === '000000000000000000000001');

    const [havePain, setHavePain] = useState((thereIsDimension) ? currentDimension.question.find(item => item.question_id === '605144b412e6f719115d52e2')?.answer : null);
    const [pains, setPains] = useState([{ label: "Cabeza", value: "Cabeza" }, { label: "Tórax", value: "Tórax" }, { label: "Espalda", value: "Espalda" }, { label: "Brazo Izquierdo", value: "Brazo Izquierdo" }, { label: "Brazo Derecho", value: "Brazo Derecho" }, { label: "Abdomen", value: "Abdomen" }, { label: "Vientre Bajo", value: "Vientre Bajo" }, { label: "Pierna Derecha", value: "Pierna Derecha" }]);
    const [painsSelected, setPainsSelected] = useState((thereIsDimension) ? currentDimension.question.find(item => item.question_id === '6051451363dbbc42e6432142')?.answer : []);
    const [howIsPain, setHowIsPain] = useState([{ label: "Quema o arde", value: "Quema o arde" }, { label: "Aprieta", value: "Aprieta" }, { label: "Palpita o salta", value: "Palpita o salta" }, { label: "Atraviesa de un lado a otro", value: "Atraviesa de un lado a otro" }, { label: "Golpes de corriente", value: "Golpes de corriente" }, { label: "Pequeños pinchazos", value: "Pequeños pinchazos" }, { label: "Pesadez", value: "Pesadez" }]);
    const [howIsPainSelected, setHowIsPainSelected] = useState((thereIsDimension) ? currentDimension.question.find(item => item.question_id === '605145648330ff55a27d6aa2')?.answer : null);
    const [howLongHurt, setHowLongHurt] = useState([{ label: "Entre 0 y 2 horas", value: "Entre 0 y 2 horas" }, { label: "Entre 3 y 6 horas", value: "Entre 3 y 6 horas" }, { label: "Entre 7 y 12 horas", value: "Entre 7 y 12 horas" }, { label: "Entre 13 y 24 horas", value: "Entre 13 y 24 horas" }, { label: "Entre 1 y 3 dias", value: "Entre 1 y 3 dias" }, { label: "Entre 4 y 7 dias", value: "Entre 4 y 7 dias" }, { label: "Entre 8 y un mes", value: "Entre 8 y un mes" }, { label: "Más de un mes", value: "Más de un mes" }])
    const [howLongHurtSelected, setHowLongHurtSelected] = useState((thereIsDimension) ? currentDimension.question.find(item => item.question_id === '605145ce12e6f719115d52e3')?.answer : null)
    const [formValues, handleInputChange] = useForm({ howMuchHurt: { value: (thereIsDimension) ? currentDimension.question.find(item => item.question_id === '6051463463dbbc42e6432143')?.answer : null, isComplete: false }, observationComment: { value: (thereIsDimension) ? currentDimension.question.find(item => item.question_id === '605146508330ff55a27d6aa3')?.answer : null, isComplete: false }});
    const { howMuchHurt, observationComment } = formValues;

    const handleSaveDimension = async () => {
        if (painsSelected.length > 0 || havePain || howIsPainSelected || howLongHurtSelected || howMuchHurt.value || observationComment.value) {

            let dimensionPain = {
                active: 1,
                description: 'Encuesta dolor',
                name: 'Dolor',
                question: [],
                _id: '000000000000000000000001'
            };

            if (havePain) {
                dimensionPain.question.push(
                    {
                        text_question: "<p>Tiene algún dolor</p>",
                        answer: havePain,
                        question_id: "605144b412e6f719115d52e2",
                        question_type: 2
                    }
                );
            }

            if (painsSelected.length > 0) {
                dimensionPain.question.push(
                    {
                        text_question: "<p>Puede Indicar hasta 3 lugares</p>",
                        answer: painsSelected,
                        question_id: "6051451363dbbc42e6432142",
                        question_type: 1
                    }
                );
            }

            if (howIsPainSelected) {
                dimensionPain.question.push(
                    {
                        text_question: "<p>¿Cómo es el dolor?</p>",
                        answer: howIsPainSelected,
                        question_id: "605145648330ff55a27d6aa2",
                        question_type: 1
                    }
                );
            }

            if (howLongHurtSelected) {
                dimensionPain.question.push(
                    {
                        text_question: "<p>¿Hace cuánto le duele?</p>",
                        answer: howLongHurtSelected,
                        question_id: "605145ce12e6f719115d52e3",
                        question_type: 1
                    }
                );
            }

            if (howMuchHurt.value) {
                dimensionPain.question.push(
                    {
                        text_question: "<p>¿Que tanto le duele?</p><p><img src=\"data:image/png;base64,\"></p>",
                        answer: howMuchHurt.value,
                        question_id: "6051463463dbbc42e6432143",
                        question_type: 3
                    }
                );
            }

            if (observationComment.value) {
                dimensionPain.question.push(
                    {
                        text_question: "<p>Observación/Comentario</p>",
                        answer: observationComment.value,
                        question_id: "605146508330ff55a27d6aa3",
                        question_type: 3
                    }
                );
            }

            saveDimension(dimensionPain);
        }
        navigation.navigate('DimensionsInto');
    }

    return (
        <View style={{flex: 1}}>
            <View style={{height: 26, width: '100%', flexDirection: 'row'}}>
                <View style={{flex: 1, justifyContent: 'center', width: '33.33%', backgroundColor: SUCCESS}}>
                    <Badge value="1" badgeStyle={{backgroundColor: WHITE}} textStyle={{color: PRIMARY}} />
                </View>
                <View style={{flex: 1, justifyContent: 'center', width: '33.33%', backgroundColor: SUCCESS}}>
                    <Badge value="2" badgeStyle={{backgroundColor: WHITE}} textStyle={{color: PRIMARY}} />
                </View>
                <View style={{flex: 1, justifyContent: 'center', width: '33.33%', backgroundColor: SUCCESS}}>
                    <Badge value="3" badgeStyle={{backgroundColor: WHITE}} textStyle={{color: PRIMARY}} />
                </View>
            </View>

            <View style={{flex: 1}}>
                <View style={{flex: 1, paddingHorizontal: 30, marginTop: 10}}>
                    <CardWithText padding={10} title={'Encuesta de dolor'}>
                        <ScrollView>
                            <Text style={{fontSize: 16, fontWeight: 'bold', color: SECONDARY, marginLeft: 10, marginBottom: 6}}>Tiene algun dolor</Text>
                            <View style={{flexDirection: 'row', alignItems: 'center', marginBottom: 20}}>
                                <TouchableOpacity onPress={() => {setHavePain('Si')}}>
                                    <RadioButton selected={havePain == 'Si'} labelRadio={'Si'}/>
                                </TouchableOpacity>
                                <TouchableOpacity onPress={() => {setHavePain('No')}}>
                                    <RadioButton selected={havePain == 'No'} labelRadio={'No'}/>
                                </TouchableOpacity>
                            </View>
                        
                            <PickerMultiSelect value={painsSelected} setValue={setPainsSelected} items={pains} setItems={setPains} max={3} label={'Puede Indicar hasta 3 lugares'} labelError={false} />

                            <View style={{flexDirection: 'row', justifyContent: 'space-between'}}>
                                <View style={{flex: 1}}>
                                    <PickerSingleSelect setItems={setHowIsPain} items={howIsPain} setValue={setHowIsPainSelected} value={howIsPainSelected} label={"¿Cómo es el dolor?"} />
                                </View>
                                <View style={{flex:0.050}}/>
                                <View style={{flex: 1}}>
                                    <PickerSingleSelect setItems={setHowLongHurt} items={howLongHurt} setValue={setHowLongHurtSelected} value={howLongHurtSelected} label={"¿Hace cuánto le duele?"} />
                                </View>
                            </View>

                            <TextArea label={'¿Que tanto le duele?'} labelError={false} onChangeText={(text) => handleInputChange(text, "howMuchHurt")} value={howMuchHurt.value} keyboardType={'default'} />                                         
                            <TextArea label={'Observación/Comentario'} labelError={false} onChangeText={(text) => handleInputChange(text, "observationComment")} value={observationComment.value} keyboardType={'default'} />
                        </ScrollView>
                    </CardWithText>
                </View>
                <View style={{flex: 0.05}}/>
            </View>
            <Fab icon={"text-box-check"} onPress={handleSaveDimension}/> 
        </View>
    )
}
